                                <input 
                                    type="text"
                                    className="form-control"
                                    placeholder="Nombre Dueño"
                                    name="propietario"
                                />
                            </div>
                        </div> {/* form-group */}



                    </form>
                </div>
            </div>
        );
    }
}

export default NuevaCita;
